CREATE DEFINER=`root`@`localhost` PROCEDURE `procedimiento_reporte1` (`dni` VARCHAR(8))  SELECT CONCAT(cli.NOMBRE_CLIENTE,' ',cli.APELLIDO_CLIENTE) AS CLIENTE,
CONCAT(vtn.FECHA,' ',vtn.HORA) as `DATO DE LA VENTA`,
CONCAT(po.NOMBRE_PRODUCTO,' ',po.DESCRIPCION) as PRODUCTO,
po.PRECIO_PRODUCTO AS PRECIO,
dv.CANTIDAD as CANTIDAD,
dv.CANTIDAD * po.PRECIO_PRODUCTO as SUBTOTAL
FROM cliente cli INNER JOIN venta vtn on cli.DNI_CLIENTE = vtn.DNI_CLIENTE INNER JOIN dtl_venta dv on vtn.ID_VENTA = dv.ID_VENTA INNER JOIN producto po on po.ID_PRODUCTO = dv.ID_PRODUCTO WHERE CLI.DNI_CLIENTE = dni$$

